import React from "react";
import { Grid } from "@material-ui/core";
import {
  List,
  ListItem,
  ListItemText,
  Paper,
  TextField,
  Button,
  Avatar
} from "@material-ui/core";
// styles
import useStyles from "./styles";

// components
// components
import { Typography } from "../../components/Wrappers";
import { showIdentification, showName } from "../../context/UserContext";

export default function TypographyPage() {
  var classes = useStyles();

  return (
    <>
      <Paper
        variant="elevation"
        elevation={5}
        className={classes.principalContainer}
        square= {false}
      >
                <div className={classes.formContainer}>
                <div className={classes.form}>

            <Typography variant="h1" className={classes.title}>
              Ingreso del bien
            </Typography> 
            <div className={classes.demo}>
            <List dense={dense}>
              {generate(
                <ListItem>
                  <ListItemText
                    primary="Single-line item"
                    secondary={secondary ? 'Secondary text' : null}
                  />
                </ListItem>,
              )}
            </List>
          </div>           
            <TextField
              id="goods"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              disabled = "true"
              margin="normal"
              placeholder="goods"
              label="Goods"
              variant="filled"              
            />
            <TextField
              id="dependece"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              disabled = "true"
              margin="normal"
              placeholder="Sistemas"
              label="Dependencia"
              variant="filled"              
            />
            <TextField
              id="name"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              disabled = "true"
              margin="normal"
              placeholder={showName}
              label={showName}
              variant="filled"              
            />
            <TextField
              id="identification"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              disabled = "true"
              margin="normal"
              placeholder="Número de identificación"
              label={showIdentification}
              variant="filled"              
            />
            <Typography variant="h2" className={classes.title}>
              Bienes a registrar
            </Typography>
            <TextField
              id = "descripcion"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              label= "Descripción"
              placeholder = "Descripción"
              variant= "outlined"
            />
            <TextField
              id = "placa"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              label= "Placa"
              placeholder = "Placa"
              variant= "outlined"
            />
              <TextField
              id = "Sede"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              label= "Sede"
              placeholder = "Sede"
              variant= "outlined"
            />
            <TextField
              id = "Espacio"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              label= "Espacio Físico"
              placeholder = "Espacio Físico"
              variant= "outlined"
            />
                        <TextField
              id = "Marca"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              label= "Marca y Serie"
              placeholder = "Marca y Serie"
              variant= "outlined"
            />
                        <TextField
              id = "Estado"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              label= "Estado"
              placeholder = "Estado"
              variant= "outlined"
            /> 
            <TextField
            id = "Motivo"
            InputProps={{
              classes: {
                underline: classes.textFieldUnderline,
                input: classes.textField,
              },
            }}
            label= "Motivo Ingreso"
            placeholder = "Motivo Ingreso"
            variant= "outlined"
          />
          <Button
          variant = "contained"
          color = "secondary"
          className ={classes.addButton}  
          startIcon = {<Avatar src='https://www.freeiconspng.com/thumbs/check-tick-icon/tick-icon-30.png' className={classes.iconC}  />}>

          </Button>
                  </div>
                </div>
        </Paper>
    </>
  );
}
